import React from "react";
import {
  SimpleShowLayout,
  useShowController,
  ShowContextProvider,
} from "react-admin";

import PageShow from "../resources/Page/PageShow";
import { Typography, Box, makeStyles } from "@material-ui/core";

import { MainList, Show } from "@semapps/archipelago-layout";
const HomePage = () => {
  const config = {
    basePath: "/Page",
    id: process.env.REACT_APP_MIDDLEWARE_URL + "pages/manifeste",
    resource: "Page",
  };

  return (
    <ShowContextProvider value={useShowController(config)}>
      <SimpleShowLayout>
        <MainList>
          <Box>
            {/* <PageShow {...config} /> */}
            <h1>lkjflks</h1>
            <p>qkldjlskjd</p>
          </Box>
        </MainList>
      </SimpleShowLayout>
    </ShowContextProvider>
  );
};

export default HomePage;
